sql_logic:
SELECT COUNT(1) FROM (
SELECT t0.account_number AS clmn0_, t0.adpoint_account_number AS clmn1_, t0.advertiser_name AS clmn2_ FROM `ncau-data-newsquery-prd.asl_finance_derived.details_dashboard` AS t0
) WHERE clmn2_ IN ('CTR_2023_AFL SPORT', 'CTR_2023_GWS GIANTS', 'CTR_2023_SYDNEY SWANS', 'CTR_2025_Greater Western Sydney Giants', 'CTR_2025_Raising Literacy Australia') LIMIT 1;
